import React from 'react';
import { MainRoot } from 'images';
import RootBackGround from 'Components/RootBackGround';
import SelectStudentComp from './SelectStudentComp';
import Alert from 'Components/Alert';

function SelectStudent({ students, handler, goBack, showPopup, onButtonTouchEnd, text }) {
    return (
        <>
            <RootBackGround
                background={MainRoot.icon_background}
                title={'학습자 선택'}
                Content={() => SelectStudentComp({ students, handler })}
                goBack={goBack}>
            </RootBackGround>
            {
                showPopup ?
                    <Alert text={text} onButtonTouchEnd={onButtonTouchEnd} /> :
                    null
            }
        </>
    );
}

export default SelectStudent;
